import "./styles.css";
import React, { useEffect, useState } from "react";
import { FormattedMessage } from "react-intl";

const Skills = () => {
  const [drop, setDrop] = useState("skills-container");
  useEffect(() => {
    setTimeout(() => setDrop("skills-container drop"), 500);
  }, []);

  return (
    <>
      <div
        className={`h-100 d-flex justify-content-center align-items-center min-vh-100 ${drop}`}
      >
        <h1>
          <FormattedMessage id='skills' />
        </h1>
      </div>
    </>
  );
};

export default Skills;
